import React, { Component } from "react";
import { MDBAlert} from "mdbreact";
import { MDBDataTable } from 'mdbreact';
import { Line } from "react-chartjs-2";
import { MDBContainer } from "mdbreact";
import "./index.css";


class App extends Component {
  componentDidMount() {
    const apiUrl = 'https://www.quandl.com/api/v3/datasets/EOD/HD?api_key=VfK8ThGsxVxyz-sgZdCh&start_date=2017-12-01&end_date=2017-12-30';
    fetch(apiUrl)
      .then((response) => response.json())
      .then((data) => console.log('This is your data', data.dataset.data));
  }
  render() {
    
    const data = {
      columns: [
        {
          label: 'Name',
          field: 'name',
          sort: 'asc',
          width: 150
        },
        {
          label: 'Position',
          field: 'position',
          sort: 'asc',
          width: 270
        },
        {
          label: 'Office',
          field: 'office',
          sort: 'asc',
          width: 200
        },
        {
          label: 'Age',
          field: 'age',
          sort: 'asc',
          width: 100
        },
        {
          label: 'Start date',
          field: 'date',
          sort: 'asc',
          width: 150
        },
        {
          label: 'Salary',
          field: 'salary',
          sort: 'asc',
          width: 100
        }
      ],
      rows: [
        {
          name: 'Tiger Nixon',
          position: 'System Architect',
          office: 'Edinburgh',
          age: '61',
          date: '2011/04/25',
          salary: '$320'
        },
        
      ]
    };

<ul>
      <h2 className='list-head'>Available Public Repositories</h2>
      {repos.map((repo) => {
        return (
          <li key={repo.id} className='list'>
            <span className='repo-text'>{repo.name} </span>
            <span className='repo-description'>{repo.description}</span>
          </li>
        );
      })}
    </ul>

  
    return (

      
        <div className="container-fluild">
          <MDBAlert color="primary">
               <h1>Fraym FS position - skill test</h1>
          </MDBAlert>
           <div className="card p-3">
             <h1></h1>
             <MDBDataTable
              striped
              bordered
              small
              data={data}
              />
           </div>

           <div className="container-fluild">
            <div className="card p-3">
                <h3 className="mt-5">Fraym FS position - skill test </h3>
                <p>visualize the historical trend of end of day stock prices for publicly</p>
                {/* <Line data={this.state.dataLine} options={{ responsive: true }} /> */}
              </div>
            </div>
        </div>
    );
  }
}

export default App;
